import jsPDF from "jspdf";
import autoTable from 'jspdf-autotable';

const print = (productsCookies, cl, dni, direccion, pay, billNumber, billType, sum, discount, ruc, razonSocial) => {
  // Obtener la fecha
  let today = new Date();
  let dd = String(today.getDate()).padStart(2, "0");
  let mm = String(today.getMonth() + 1).padStart(2, "0"); //January is 0!
  let yyyy = today.getFullYear();

  // Obtener la hora
  function addZero(i) {
    if (i < 10) {i = "0" + i}
    return i;
  }
  let h = addZero(today.getHours());
  let m = addZero(today.getMinutes());
  let s = addZero(today.getSeconds());
  let time = h + ":" + m + ":" + s;

  let infoBill = [];
  let total = (Math.round((sum).toFixed(2) * 100) / 100).toFixed(2);
  const pdf = new jsPDF("p", "mm", "a4");
  require('jspdf-autotable');

  // cuadrado en el pdf
  pdf.rect(140, 20, 50, 40);

  // muestra ruc en el pdf
  pdf.setFontSize(10);
  pdf.text(145, 30, "R.U.C.: 20604470081");

  // condicional para el tipo de factura en el pdf
  if (billType === 1) {
    pdf.setFontSize(15);
    pdf.text(150, 40, "Nota de Venta");
  } else if (billType === 2) {
    pdf.setFontSize(15);
    pdf.text(145, 40, "Boleta de Venta");
  } else if (billType === 3) {
    pdf.setFontSize(15);
    pdf.text(150, 40, "Factura");
  } else if (billType === 4) {
    pdf.setFontSize(15);
    pdf.text(150, 40, "Cotización");
  } else {
    pdf.setFontSize(15);
    pdf.text(159, 40, "");
  }

  // muestra numero de factura
  pdf.setFontSize(10);
  pdf.text(
    145,
    50,
    `Nº ${billNumber[0].serieDoc + "-" + billNumber[0].nroDoc}`
  );

  const logo =
    "data:image/png;base64,";

  // agrega logo de la empresa
  pdf.addImage(logo, "JPEG", 10, 10, 30, 30);

  // muestra nombre de empresa
  pdf.setFontSize(15);
  pdf.text(45, 20, "IMPORTACIONES NOARG E.I.R.L");

  // muestra direccion de empresa
  pdf.setFontSize(10);
  pdf.text(45, 25, "Dirección: Calle la mar 299 - Ica");

  // muestra telefono de empresa
  pdf.setFontSize(10);
  pdf.text(45, 30, "Tlf: 993-208-412 / 936-600-625");

  // muestra una linea
  pdf.line(20, 45, 85, 45);

  // muestra informacion del cliente
  pdf.setFontSize(10);
  pdf.text(20, 50, `Cliente: ${cl} DNI: ${dni}`);
  pdf.text(20, 55, `Dirección: ${direccion}`);

  // condicional para ruc y razon social
  if (billType === 1 || billType === 2) {
    pdf.setFontSize(10);
        pdf.text(20, 85, ``);
    pdf.setFontSize(10);
        pdf.text(20, 90, ``);
} else {
    // Muestra RUC
    pdf.setFontSize(10);
        pdf.text(20, 65, `RUC: ${ruc}`);
    // Muestra Razon Social
    pdf.setFontSize(10);
        pdf.text(20, 70, `Razón Social: ${razonSocial}`);
}

  // condicional para subtotal, igv y fecha
  if (billType === 1 || billType === 2) {
    // muestra la fecha
    pdf.setFontSize(10);
    pdf.text(20, 60, `Fecha Emision: ${dd + "/" + mm + "/" + yyyy} Hora: ${time}`);
    pdf.setFontSize(10);
    pdf.text(150, 75, ``);
    pdf.setFontSize(10);
    pdf.text(150, 80, ``);
  } else {
    // Muestra Subtotal
    pdf.setFontSize(10);
    pdf.text(150, 70, `Subtotal: S/ ${sum}`);
    // Muestra IGV
    pdf.setFontSize(10);
    pdf.text(
      150,
      75,
      `IGV(18%):  S/ ${(
        Math.round(((sum * 1.18).toFixed(2) - sum) * 100) / 100
      ).toFixed(2)}`
    );
    // muestra la fecha
    pdf.setFontSize(10);
    pdf.text(20, 55, `Fecha Emision: ${dd + "/" + mm + "/" + yyyy} Hora: ${time}`);
  }

  // cuadrado en el pdf
  pdf.rect(147, 80, 35, 8);

  // muestra el total
  pdf.setFontSize(10);
  pdf.text(
    150,
    85,
    `Total: S/ ${total}`
  );

  // Muestra una linea
  pdf.line(20, 70, 85, 70);

  // lista de informacion de la venta
  let info = []
  if (billType === 4) {
    info = [
      "\n" +
        "                    Monto a pagar: S/ " +
        total +
        "\n" +
        "                    Descuento: S/ " +
        discount +
        "\n" +
        "                    Total a pagar: S/ " +
        total +
        "\n \n" +
        "                    Cuentas BCP: \n" +
        "                    Corriente Soles: 3802552369086 \n" +
        "                    CCI: 00238000255236908642\n" +
        "                    Corriente Dólares: 3802519002157 \n" +
        "                    CCI: 00238000251900215743",
    ];
  } else {
    info = [
      "\n" +
        "                    Monto a pagar: S/ " +
        total +
        "\n" +
        "                    Descuento: S/ " +
        discount +
        "\n" +
        "                    Total a pagar: S/ " +
        total +
        "\n" +
        "                    Pago con: S/ " +
        pay +
        "\n" +
        "                    Vuelto: S/ " +
        (Math.round((pay - total) * 100) / 100).toFixed(2) +
        "\n \n" +
        "                    Cuentas BCP: \n" +
        "                    Corriente Soles: 3802552369086 \n" +
        "                    CCI: 00238000255236908642\n" +
        "                    Corriente Dólares: 3802519002157 \n" +
        "                    CCI: 00238000251900215743",
    ];
  }
  infoBill.push(info);

  // Muestra: Monto a pagar, Descuento, Total a pagar, Pago con, Vuelto.
  pdf.setFontSize(10);
  pdf.text(10, 75, `${infoBill.join("")}`);

  // Valores de cada fila
  const result_table = [];
  for (let x = 0; x < productsCookies.length; x++) {
    let name = [
      productsCookies[x].codProd,
      productsCookies[x].nombreProducto,
      productsCookies[x].ubicacion,
      productsCookies[x].cantidad,
      "S/ " + productsCookies[x].precioVenta,
      "S/ " +
        (productsCookies[x].precioVenta * productsCookies[x].cantidad).toFixed(
          2
        ),
    ];
    // agrega cada valor al array vacio
    result_table.push(name);
  }

  // genera la tabla en pdf
  pdf.autoTable({
    margin: { top: 130 },
    theme: "grid",
    head: [["Código", "Nombre", "Ubicacion", "Cantidad", "Precio", "Total"]],
    body: result_table,
    columnStyles: { halign: "center" },
    headStyles: {
      lineColor: [0, 0, 0],
      textColor: [0, 0, 0],
      fillColor: [255, 255, 255],
      lineWidth: 0.1,
    },
    bodyStyles: { lineColor: [0, 0, 0], textColor: [0, 0, 0] },
    didDrawCell: function(data) {
      data.settings.margin.top = 10;
    },
  });

  pdf.save(`venta-${billNumber[0].serieDoc + "-" + billNumber[0].nroDoc}`);
};

export default print;
